import React from 'react';
import './App.css';

import YouTubeVideoList from '../YouTubeVideoList/YouTubeVideoList';
import Header from '../Header/Header';

function App() {
  return (
    <div className="App">
      <Header />
      <YouTubeVideoList />
      <YouTubeVideoList />
      <YouTubeVideoList />
      <YouTubeVideoList />
    </div>
  );
}

export default App;
